class user {
    constructor(id,fn,sn,img,email,mark,countState,isAdmin){
        this.id =  id,
        this.fn = fn,
        this.sn = sn,
        this.img = img,
        this.email = email,
        this.mark = mark,
        this.countState = countState,
        this.isAdmin = isAdmin
